import React, { Component } from "react";
import Menu from "./Menu";

export default class Logo extends Component {
	constructor () {
		super()
		this.state = {
			name: 'Qtemu',			
		};
	}

	render (){
		return(
			<Menu name = {this.state.name}/>
		)
	}
}
